	        on_talk:  "speech_dialog(		self,	[~Hey.~],
	              									set(level.player.animation, 'emote_confused'),
	        						level.player,	[~Hey.~],
	        								self,	[~Hey.~],
	           		   								set(level.player.animation, 'emote_nod'),
	        						level.player,	[~... I see.~],
	        										[~Mind if I ask what you're doing here?\\nYou don't seem like you're just chilling out.~],
	        								self,	[~Hey.~],
	           		   								set(level.player.animation, 'emote_geez'),
	        						level.player,	[~Come on, dude.\\nCut it out.~],
	        								self,	[~Yeah, yeah, sorry, I'm just messing with you.\\nI've got a really boring job here.~],
	           		   								set(level.player.animation, 'emote_raisedfinger'),
	        						level.player,	[~Being a smartass always helps.~],
	        								self,	[~Yeah, it's about all I can do to kill time.\\nGotta stay alert.~],
	              									set(level.player.animation, 'emote_confused'),
			   						level.player,	[~... it sounds like you're on some\\nkind of guard duty or something like that?~],
			   						self, 			[~Yep.~],
	              									set(level.player.animation, 'emote_talk'),
			   						level.player,	[~... guarding against?~],
			   						self, 			[~Oh, whoa, you don't know?\\nAt all?~],
	           		   								set(level.player.animation, 'emote_talk'),
			   						level.player,	[~No, not really,\\nI'm not from around here.~],	
			   						self,			[~I see.  So yeah, uh... well...\\nWe have a mushroom problem.~],
			   										[~Really bad.~],
			   										[~I mean, we've always had some, you know...\\n<em>normal</em> mushrooms since forever.~],
			   										[~A couple years ago, maybe - might've started \\nearlier than that, things got a little weird.~],
			   										[~East of here there's a kind of boggy area.\\nNot many people go down there anyways.~],
			   										[~So I guess we didn't notice it for a while,\\nbut the trees down there started dying.~],
			   										[~The leaves turned strange colors.\\nOdd plants we haven't seen before started growing.~],
			   										[~The water soured and turned to poison.~],
	              									set(level.player.animation, 'emote_confused'),
			   						level.player,	[~Holy shit, this sounds kinda ... <em>apocalyptic</em>.~],	
	              					self,			[~Yeah, things've been getting kinda scary.~],	
			   										[~So, it really got kinda nasty down there,\\n and it's been slowly spreading this way.~],
			   										[~The worst thing that's happened recently\\nis the mushrooms.~],
			   										[~They started moving.~],
	              									set(level.player.animation, 'emote_confused'),
			   						level.player,	[~Like a venus fly-trap?~],
			   						self,			[~Like an animal.~],
	              									set(level.player.animation, 'emote_geez'),
			   						level.player,	[~That ain't good.~],
			   						self,			[~Nope.  It ain't good at all.~],
			   										[~So that was when we finally really\\nhad to get our act together.~],
			   										[~We're kinda informal around here,\\nand it was hard to get people to do something\\nuntil the problem hit home.~],
			   										[~I mean, it wasn't <em>our</em> problem\\nuntil it came here.~],
			   										[~Who cares if something's weird in the bog, right?\\nIt can have it.  That place sucked anyways.~],
			   										[~But now people were getting sick here,\\nand getting attacked, and just ...~],
			   										[~So the biggest problem is we really don't\\n know what the hell <em>to</em> do.~],
			   										[~We can kill the mushrooms that walk around,\\nbut new ones keep sprouting.~],
			   										[~We think the walkers might spread the infestation;\\nmight be seeds for a new patch.~],
			   										[~So we don't want them to get out.~],
	              									set(level.player.animation, 'emote_geez'),
			   						level.player,	[~But can't they just ...\\nspread in all directions?~],
			   						self,			[~Actually, no; it seems like there's\\n something in the geography...~],
			   										[~It seems like we're really lucky, somehow.\\nThe bog is down in a valley,\\nand it's got pretty sheer cliffs on most sides.~],
			   										[~And maybe there are some conditions\\nwhere they can't survive in anyways,\\nso it can't spread there.~],
			   										[~The Alteborea's pretty high and dry; colder, too.\\nMaybe they just can't grow there?~],
			   										[~It's part of the forest;\\nborders the bog on the north side.~],
			   										[~We really don't know, and that's scary.~],
			   										[~What we DO know is they kept trying\\nto cross this bridge, so, well, we removed it.~],
			   										[~We slung together a rope-pulley\\nto cross it, instead.~],
			   										[~Not like anyone wants to go over there anyways.~],
			   										[~So that and guard duty has\\nkinda kept stuff in check.~],
			   										[~We patrol around and look for\\nsigns of spread.~],
			   										[~Not much - every once in a while\\nwe'll see one that's gotten out.~].
			   										[~It's enough to keep us on our toes, though.~],
			   										[~We burn the dead mushrooms;\\nthat seems to keep them from planting spores.~],
	              									set(level.player.animation, 'emote_confused'),
			   						level.player,	[~You sure the mushrooms are spreading it?~],
			   						self,			[~No, but we've got nothing to go on.\\nIt's a best guess.~],
			   										[~The big problem is this is just a stalemate.~],
			   										[~We have <em>no</em> idea how to\\nexterminate this.~],
			   										[~So if it ever does get out,\\nif it gets in the ground...~],
			   										[~I don't know what we'd do.~],
			   										[~We really don't have anyone to go\\nto for help, so ... that's that.~],
			   										[~Anyways, if you're crazy enough to want to\\ngo over there, feel free to ride across.~],
			   										[~Don't worry, there's <em>always</em> someone\\non duty here, so you can always get back.~],
	              									set(level.player.animation, 'emote_confused'),
			   						level.player,	[~Well.. uh, thanks for that story.\\nI'll stop bugging you now, but thanks.~],
	              									set(level.player.animation, 'emote_confused'),
			   						level.player,	[~That was <em>very important</em> to know.~],
			   						)",
